import { sha256 } from 'js-sha256';

function Hash() {
    const url = " https://github.com/cse442-21f/FP-Blockchain/blob/main/docs/text/helloworld.txt";
    const medalsData = (() => {
        var medalsData = null;                                                      
        $.ajax({                                                                    
            'async': false,                                                         
            'url': url,                                                             
            'dataType': "json",                                                     
            'success': (data) => {                                                  
                medalsData = data;                                                  
            }                                                                       
        });                                                                         
        return medalsData;                                                          
    })();    

    return (
        sha256("Hello World")
    );
}

export default Hash;
